import React, { Component } from 'react';
import { withTheme } from '@material-ui/core';
// import '../../sass/components/_card.scss';

class Card extends Component {
  render() {
    const cardImageStyling = {
      backgroundImage: `url(${this.props.data.img})`
    };

    return (
      <a href='/1' className='card'>
        <div key={this.props.data.id} className='card-body'>
          <div className='card-img' style={cardImageStyling} alt=''>
            <div className=''>
              {this.props.data.openhouse ? (
                <div className='banner open-house'>
                  {this.props.data.openhouse}
                </div>
              ) : (
                ''
              )}
              {this.props.data.comingsoon ? (
                <div className='banner banner-message'>
                  {this.props.data.comingsoon}
                </div>
              ) : (
                ''
              )}

              <div className='card-caption'>
                <div className='flex-col'>
                  <div className='flex '>
                    <div className='card-listing-left-wrapper'>
                      <div>
                        {Number(this.props.data.price).toLocaleString()}
                      </div>
                      <div>{this.props.data.address}</div>
                      <div>{this.props.data.neighborhood}</div>
                    </div>
                    <div className='card-listing-right-wrapper'>
                      <div>
                        {this.props.data.beds} <div>Beds</div>
                      </div>
                      <div>
                        {this.props.data.baths} <div>Baths</div>
                      </div>
                      <div>
                        {Number(this.props.data.sq).toLocaleString()}{' '}
                        <div>Sq. Ft.</div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </a>
    );
  }
}

export default Card;
